import React from 'react'
import { Table, Row, Col, Menu, Card, Input, Select, InputNumber, Divider, Button, Modal, Drawer } from 'antd'
import { TcrbButton, TcrbPopconfirm } from '../../antd-styles/styles'
import { Formik, Field, Form } from "formik";

import SimpleInput from '../../simple-input'

const UserList = () => {
  return (
    <div>
      <Row gutter={[4, 24]}>
        <Col span={2}>
          <TcrbButton className="primary" onClick={() => openModalAddNewRole()} >Add User</TcrbButton>
        </Col>
      </Row>
      <Formik
        initialValues={{ name: "", email: "" }}
        onSubmit={values => {
          console.log(values)
        }}

        render={({
          touched,
          errors,
          values,
          handleChange,
          handleBlur,
          handleSubmit,
        }) => (
            <Form onSubmit={handleSubmit}>
              <div>
                Email *
                {touched.email &&
                  errors.email && <Text color="red">{errors.email}</Text>}
                <Input
                  onChange={handleChange}
                  onBlur={handleBlur}
                  value={values.email}
                  border={touched.email && errors.email && "1px solid red"}
                  type="text"
                  name="email"
                  placeholder="Email"
                />
              </div>
              <div>
                Password *
                {touched.password &&
                  errors.password && <Text color="red">{errors.password}</Text>}
                <Input
                  onChange={handleChange}
                  onBlur={handleBlur}
                  value={values.password}
                  border={
                    touched.password && errors.password && "1px solid red"
                  }
                  type="password"
                  name="password"
                  placeholder="Password"
                />
              </div>
              <Button type="submit">Submit</Button>
            </Form>
          )}
      />
    </div>
  )
}

export default UserList
